//
//Set the Last Segment in Memory, To be used when dynamically generating segments.
channelMap.put("_trackLastSegment","PV1");

//
// DG1 Segment
//
//Create Segment is Diagnosis Code 1 is not empty
//This script also builds the array of Diagnosis segments and adds to the Message.
var diagnosisValueArray = new Array();

//Append disgnosisArray
var _tempDG1 = msg['row'][0]['column23'].toString(); //dg1-1code
var _tempDG2 = msg['row'][0]['column24'].toString(); //dg1-1desc
var _tempDG3 = msg['row'][0]['column25'].toString(); //dg1-2code
var _tempDG4 = msg['row'][0]['column26'].toString(); //dg1-2desc

var diagnosisValueArray = [
    { code: _tempDG1, description: _tempDG2 },
    { code: _tempDG3, description: _tempDG4 }
];
/*
if(_tempDG1 != "") {
	diagnosisValueArray1.push(_tempDG1);
}
if(_tempDG2 != "") {
	diagnosisValueArray2.push(_tempDG2);
}

if((_tempDG3) != "") {
	diagnosisValueArray1.push(_tempDG3);
}
if((_tempDG4) != "") {
	diagnosisValueArray2.push(_tempDG4);
}
*/

//Now we have the Value Array. For each value in the value array
//Create a Diagnosis Code Segment and add to the parent message.
for (var i = 0; i < diagnosisValueArray.length; i++) {
    var diagnosis = diagnosisValueArray[i];

    // Create a new DG1 segment
    var dg1Segment = createSegment('DG1');

    // DG1 fields
    dg1Segment['DG1.1']['DG1.1.1'] = (i + 1).toString();      // Set ID 
    dg1Segment['DG1.2']['DG1.2.1'] = "I10";
    dg1Segment['DG1.3']['DG1.3.1'] = diagnosis.code;  // Diagnosis Code 
    dg1Segment['DG1.4']['DG1.4.1'] = diagnosis.description;   				// Diagnosis Description
    dg1Segment['DG1.6']['DG1.6.1'] = '';              		// Diagnosis Date 

  	// to the PV1 segment.
	tmp[channelMap.get('_trackLastSegment').toString()] += dg1Segment;
	channelMap.put("_trackLastSegment","DG1");
}


//IN1 Segment.
tmp['IN1']['IN1.2']['IN1.2.1'] = msg['row'][0]['column27'].toString(); //plan id
tmp['IN1']['IN1.3']['IN1.3.1'] = msg['row'][0]['column28'].toString(); //insurance
tmp['IN1']['IN1.36']['IN1.36.1'] = msg['row'][0]['column29'].toString(); //policy no
channelMap.put("_trackLastSegment","IN1");

